import React from "react";
import { Link } from "react-router-dom";
import "../style/NavBar.css";

const NavBar = () => {
  return (
    <nav>
      <Link to="/" className="link logo">
        Masak Yuk
      </Link>
      <ul>
        <li>
          <Link to="/student" className="link">
            Resep
          </Link>
        </li>
        <li>
          <Link to="/add" className="link">
            Resepmu
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
